import React, { useEffect, useState } from 'react'
import Layouts from '../../Layouts/Layouts'
import { useLoginManager } from '../../StateManagement/UserManagement';
import { useNavigate } from 'react-router-dom';
import img from './../../assests/images/Icons/maths.png';
import axios from 'axios';
function ProjectToGuide() {
    const temp =sessionStorage.getItem('sessionData');
    let userID;
    if(temp)
    {
        userID =     JSON.parse(temp).data[0].TeacherID;

    }

    const navigate = useNavigate();
    const [datas,setData] = useState();

    useEffect(()=>{
      const getData = async()=>{
        try{
            const response  = await axios.get(`http://localhost:3001/t/guideProjects/${userID}`);
            setData(response.data);
        }
        catch(error)
        {  
            console.log(error);
        }
      }
      getData();
    },[])
    console.log(datas);
  return (
    <Layouts>
        <div className='flex felx-col md:flex-row lg:flex-row justify-around mt-2 items-center'>
        {datas?.map((data,index)=>(
            <div key={index}>
            <div className='flex flex-col items-center gap-2' >
        <img src={img} alt='data' width={150} className='rounded-full bg-bgBlueDark'/>
        <label className='text-xl '>
        {data.ProjectID}
    </label>
    </div>
            </div>
        ))}
        </div>
    </Layouts>
  )
}

export default ProjectToGuide
